import './Logement.css';
import React, { useState, useEffect } from 'react';

function Logement() {

  const [logement, setLogement] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8000/v1/users")
      .then((res) => res.json())
      .then((data) => {
        const loge = data.map((tuple) => ({
          adresse: tuple[3],
          nb_pieces: tuple[4],
          type: tuple[5],
          surface: tuple[6],
          etat: tuple[7],
          objectif_gestion: tuple[8],
          date_dispo: tuple[9],
          etat: tuple[10],
          prix: tuple[11]
        }));
        setLogement(loge);
      })
      .catch((error) => console.error(error));
  }, []);


  return (
    <div>
      {data ? (
        <ul>
          {data.map((item) => (
            <li key={item.id}>{item.name}</li>
          ))}
        </ul>
      ) : (
        <p>Loading data...</p>
      )}
    </div>
  );

}

export default Logement;
